import React from "react";

const AssetRow = ({ asset, handleSellAsset }) => {
    return (
        <tr>
            <td>{asset.INV_NUMBER}</td>
            <td>${parseFloat(asset.COST).toFixed(2)}</td>
            <td>{asset.NAME}</td>
            <td>{asset.MODEL}</td>
            <td>
                <form>
                    <button 
                    type="button" class="btn btn-danger mx-2">Sell Asset
                    onClick={(event) => handleSellAsset(event, item)}
                    </button>
                </form>
            </td>
        </tr>
    )
}

export default AssetRow;
